import { Pressable } from "../src/components/Pressable";
import { StoryBlock, StoryPart } from "./_StoriesComponents";

const styles = StyleSheet.create({
  container: {
    alignSelf: "flex-start",
  },
});

export default {
  title: "Forms/Checkbox",
  component: LakeCheckbox,
} as ComponentMeta<typeof LakeCheckbox>;

const InteractiveCheckbox = ({
  defaultValue = false,
  ...props
}: Omit<CheckboxProps, "value"> & { defaultValue?: boolean }) => {
  const [value, setValue] = useState(defaultValue);

  const toggle = () => {
    setValue(v => !v);
  };

  return (
    <Pressable style={styles.container} onPress={toggle} disabled={props.disabled}>
      <LakeCheckbox value={value} {...props} />
    </Pressable>
  );
};

